import React from 'react';
import UsersItem from "./usersItem";

const UsersList = ({users, title,subtitle}) => {
    return (
        <div>
            <h1>
                {title}
            </h1>
            <h2>
                {subtitle}
            </h2>
            {users.map((user) =>
                <UsersItem number={user.id+1} user={user} key={user.id}/>
            )}

        </div>
    );
};

export default UsersList;
